import React from 'react';

class DataHeader extends React.Component {
	render (){
		return (
			<div className="DataHeader">
				<header class="header">
					<div class="container">     
						<div class="row align-items-end">
							<div class="col">
								<div class="profile-content">
									<h1>ข้อมูลผู้ใช้</h1>
									<h1></h1>
									<h2 class="btn btn-cta-secondary btn-small round margin-right-s" href="#" target="_blank">ข้อมูลสำคัญ</h2>
									<h2 class="btn btn-cta-secondary btn-small round margin-right-s" href="#" target="_blank">ข้อมูลเพิ่มเติม</h2>
									<h2 class="btn btn-cta-secondary btn-small round" href="#" target="_blank">ประวัติการศึกษา</h2>
									
								</div>
							</div>
						</div>        
					</div>
				</header>
				<div class="col-12 col-md-auto">
								<a class="btn btn-cta-primary-yellow round" href="#" target="_blank">ยืนยันตัวตน</a>
				</div>
			</div>
		);
	}
}

export default DataHeader;
